import React, { Component } from 'react'
import Navbar2 from './Navbar2'
import Footer from './Footer'
import { Breadcrumb } from 'react-bootstrap';
import '../CSS/style.css'

export default class Services extends Component {

    constructor(props){
        super(props)
        this.state={
            name:'',
            email:'',
            contact:'',
            address:'',
            category:'',
            restaurant:'',
            location:'',
            time:'',
            date: new Date(),
            seats:'',
            parking:'',
            userId:'',

            list:[], //for category
            list2:[], // for userId session
            reslist:[],  // for restaurant
        }
        
        this.state.list2= JSON.parse( localStorage.getItem('login'));  
        this.state.userId = this.state.list2[0].id     
        
        //to fetch categories
        fetch('http://localhost:8080/categories').then((resp) => {
            resp.json().then((data) => {
                this.setState({
                    list:data
                })
            })
        })

        //to fetch restaurants
        fetch(`http://localhost:8080/restaurant`).then((resp) => {
            resp.json().then((data) => {
                this.setState({
                    reslist:data
                })
            })
        })
    }





    render() {

        return (

            <div>

            <div className="main">
                <Navbar2/>
                <Breadcrumb>
                     <Breadcrumb.Item href="/"><h5 className="bread">Home</h5></Breadcrumb.Item>
                        <Breadcrumb.Item href="/service">
                            <h5 className="bread">Services</h5>
                        </Breadcrumb.Item>
                    <Breadcrumb.Item active>Data</Breadcrumb.Item>
                </Breadcrumb>

                <div className="container form-content">		
                    <div className="header_content">
                        <h2> My Bookings</h2>
                    </div>
                    
                    <div className="card col-md-6 main-form">
                        <div className="card-header">
                            <h3 className="mt-2" style={{color:"red"}}> Pending Bookings  </h3>
                        </div>
                        <div className="card-body">
                            <form className="form row">
                                
                                                      

                            </form>
                        </div>
                    </div>
                </div>

        <Footer/>
        </div>
        </div>
        )
    }
}
